A deeper look into the build itself. White does reflect the RGB light more than any other color, so it lets it shine quite a bit more. Would you go for a white case as your main PC?

First impressions of the case:  Plentiful airflow, extremely easy to pop the front panel and glass panels off without having to move around other parts. PSU windows, however, are something I don't understand but that many manufacturers are going for, as usually PSUs aren't pretty enough to deserve a center spot in a build. 

